import '../../styles/InsuranceCard.css';
import React,{Component} from 'react';
import {Grid, Card, CardContent, CardMedia,Typography} from '@material-ui/core';
import {DriveEta, LocalHospital} from '@material-ui/icons';

class InsuranceCard extends Component{

    render(){
        return <Grid item xs = {4}>
            <Card>
                <CardContent className = 'card-content'>
                    <Typography component="h5" variant="h5">
                        {this.props.insurance.name}
                    </Typography>
                    {this.getIcon()}
                </CardContent>
            </Card>
        </Grid>
    }

    getIcon = () => {
        return <div className = 'card-media'>
            {this.getIconFromType(this.props.insurance.type)}
        </div>
    }

    getIconFromType = (type) => {
        switch(type){
            case 'vehicle':
                return <DriveEta/>;
            case 'medical':
            default:
                return <LocalHospital/>;
        }
    }


}

export default InsuranceCard;
